INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(34, 1, '2014-09-01 07:44:31', '2014-09-01 07:44:31', 'In a time where functionality beats essence, we want to bring back the warmth and joy of the purest material in Teak. Striking the timeless balance of classic English design and contemporary look, we present a unique look in our lineup. Details in every single curve is carefully thought to not only enhance the shape of the product but to maximize the level of comfort and enjoyment.\r\n\r\nSelecting the right material is essential in shaping our product, utilizing the most effective way to combine appearance and sustainability, we are able to create distinct look in a most ecological way. Teak with its beautiful timeless grain blends naturally with the outdoor setting while being one of the most durable material, free of natural defects and rusts.\r\n\r\nBringing the feel and comfort from indoor to outdoor is the objective that transpires in our collections - unconventional finishes in classical design while exploring new method in reinventing the idea of what teak furniture is about.', 'Story', '', 'publish', 'open', 'open', '', 'about-us', '', '', '2014-09-05 11:31:05', '2014-09-05 11:31:05', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?page_id=34', 0, 'page', '', 0);
