INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(57, 1, '2014-09-04 04:04:08', '2014-09-04 04:04:08', 'Since getting FSC recertification in 2011, we have been working hand in hand with Perhutani (Indonesia state owned forestry) to bring awareness to the market place about the sustainability in this initiative. Responsibility in safeguarding this legacy of Teak plantation falls to every part in the chain from the harvester, producer, distributor and consumer in the market place.\r\n\r\nCambridge Casual is proud to be able to offer FSC certified teak in our collection as a way to further establish our commitment towards sustainability. With more than 75% of the current available teak forest unit still in needs of assistance in achieving the prestigious status of FSC certified, we’re gearing this initiative back from the market to the source.\r\n\r\nWe realize that this drive from end consumer is exponentially more effective than the pursue coming from the source. Cambridge casual sees this as an opportunity to be the initiator of sustainability awareness in bringing lifestyle to the market responsibly.', 'Sustainability', '', 'publish', 'open', 'open', '', 'sustainability', '', '', '2014-09-05 10:18:04', '2014-09-05 10:18:04', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?page_id=57', 0, 'page', '', 0);
