INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(128, 1, '2014-09-05 09:54:23', '2014-09-05 09:54:23', '', 'Contact Us', '', 'inherit', 'open', 'open', '', '127-revision-v1', '', '', '2014-09-05 09:54:23', '2014-09-05 09:54:23', '', 127, 'http://cambridgecasual.192.168.1.205.xip.io/127-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(129, 1, '2014-09-05 09:56:11', '2014-09-05 09:56:11', 'All our product is made in our reputable partner factory using the strictest quality standard from selecting the best material, timber conditioning, construction, finishing and after care to ensure customer satisfaction. Due to natural variation in Teak, every product and finish that we created is unique embodying the characteristic of the nature.\r\n\r\nMaterial\r\nFrom the beginning, we only use the finest material that has the stability, free of natural defects ensuring only the most durable material gets to the customer.\r\n\r\nConditioning\r\nGoing through specific different process of stacking, airing and kiln drying, extracting the moisture out from the timber without losing its natural characteristic and attributes.\r\n\r\nProduction\r\nFully machine mortise and tenon construction, with very stringent standard that allows expansion and contraction of the wood when exposed to different outdoor humidity.\r\n\r\nFinishing\r\nSeveral different hand rubbing steps applied to create a distinct weather or rustic look prior to spraying color and protective layer ensuring that each product is unique to its grain character.', 'Our Product', '', 'publish', 'open', 'open', '', 'our-product', '', '', '2014-09-05 10:21:14', '2014-09-05 10:21:14', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?page_id=129', 0, 'page', '', 0);
INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(130, 1, '2014-09-05 09:56:11', '2014-09-05 09:56:11', 'Material\r\nFrom the beginning, we only use the finest material that has the stability, free of natural defects ensuring only the most durable material gets to the customer. \r\n\r\nConditioning\r\nGoing through specific different process of stacking, airing and kiln drying, extracting the moisture out from the timber without losing its natural characteristic and attributes.\r\n\r\nProduction\r\nFully machine mortise and tenon construction, with very stringent standard that allows expansion and contraction of the wood when exposed to different outdoor humidity.\r\n\r\nFinishing\r\nSeveral different hand rubbing steps applied to create a distinct weather or rustic look prior to spraying color and protective layer ensuring that each product is unique to its grain character.\r\n', 'Our Product', '', 'inherit', 'open', 'open', '', '129-revision-v1', '', '', '2014-09-05 09:56:11', '2014-09-05 09:56:11', '', 129, 'http://cambridgecasual.192.168.1.205.xip.io/129-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(131, 1, '2014-09-05 09:58:17', '2014-09-05 09:58:17', '', 'Maintenance', '', 'publish', 'open', 'closed', '', 'maintenance', '', '', '2014-09-05 11:38:26', '2014-09-05 11:38:26', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?p=131', 7, 'nav_menu_item', '', 0);
INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(132, 1, '2014-09-05 09:58:33', '2014-09-05 09:58:33', 'Teak is the ideal material for outdoor usage, has been long known for its esthetic, durability, resistant to defects and its ability to withstand the element it has been the ideal material for the most extreme usage.\r\n\r\nWith that being said, Teak is a living material that will evolve over time. Under constant sunlight, Teak naturally will experience some oil surfacing and small cracks might appear as this is naturally occurring properties of Teak towards the element. Over time under constant rain and sunshine, Teak natural color will turn into a beautiful silver patina grey.\r\n\r\nOur Teak finishes is created through delicate process that will age naturally over time. As season usage, the finish will starts to fade, exposing the natural teak that aged into silvery grey look akin to the unfinished teak. To maintain its original finish and ensure its longevity, we recommend that you do regular maintenance;\r\n\r\n• Dust regularly with soft cloth following the wood grain\r\n• Should you attempt to clean the furniture, only use mild soap and slightly damp sponge then quickly wipe dry\r\n• Always store the furniture inside or use furniture cover when not in use\r\n• Avoid prolonged contact with water as in can cause the wood to absorb moisture', 'Teak Care', '', 'publish', 'open', 'open', '', 'teak-care', '', '', '2014-09-05 10:25:07', '2014-09-05 10:25:07', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?page_id=132', 0, 'page', '', 0);
