INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(141, 1, '2014-09-05 10:03:49', '2014-09-05 10:03:49', 'All our product is made in our reputable partner factory using the strictest quality standard from selecting the best material, timber conditioning, construction, finishing and after care to ensure customer satisfaction. Due to natural variation in Teak, every product and finish that we created is unique embodying the characteristic of the nature.\r\n\r\nMaterial\r\nFrom the beginning, we only use the finest material that has the stability, free of natural defects ensuring only the most durable material gets to the customer. \r\n\r\nConditioning\r\nGoing through specific different process of stacking, airing and kiln drying, extracting the moisture out from the timber without losing its natural characteristic and attributes.\r\n\r\nProduction\r\nFully machine mortise and tenon construction, with very stringent standard that allows expansion and contraction of the wood when exposed to different outdoor humidity.\r\n\r\nFinishing\r\nSeveral different hand rubbing steps applied to create a distinct weather or rustic look prior to spraying color and protective layer ensuring that each product is unique to its grain character.\r\n', 'Our Product', '', 'trash', 'open', 'open', '', 'our-product-2', '', '', '2014-09-05 10:10:18', '2014-09-05 10:10:18', '', 0, 'http://cambridgecasual.192.168.1.205.xip.io/?page_id=141', 0, 'page', '', 0);
