INSERT INTO `cc_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES(151, 1, '2014-09-05 10:25:07', '2014-09-05 10:25:07', 'Teak is the ideal material for outdoor usage, has been long known for its esthetic, durability, resistant to defects and its ability to withstand the element it has been the ideal material for the most extreme usage.\r\n\r\nWith that being said, Teak is a living material that will evolve over time. Under constant sunlight, Teak naturally will experience some oil surfacing and small cracks might appear as this is naturally occurring properties of Teak towards the element. Over time under constant rain and sunshine, Teak natural color will turn into a beautiful silver patina grey.\r\n\r\nOur Teak finishes is created through delicate process that will age naturally over time. As season usage, the finish will starts to fade, exposing the natural teak that aged into silvery grey look akin to the unfinished teak. To maintain its original finish and ensure its longevity, we recommend that you do regular maintenance;\r\n\r\n• Dust regularly with soft cloth following the wood grain\r\n• Should you attempt to clean the furniture, only use mild soap and slightly damp sponge then quickly wipe dry\r\n• Always store the furniture inside or use furniture cover when not in use\r\n• Avoid prolonged contact with water as in can cause the wood to absorb moisture', 'Teak Care', '', 'inherit', 'open', 'open', '', '132-revision-v1', '', '', '2014-09-05 10:25:07', '2014-09-05 10:25:07', '', 132, 'http://cambridgecasual.192.168.1.205.xip.io/132-revision-v1/', 0, 'revision', '', 0);
