INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(3, 3, 'collections', 'Catalunya collection represents a unique identity that combines a deep tradition of weave whilst utilizing natural material in teak. Maintaining natural feel and look while enhancing the comfort, creating an unmistakeable image and class.', 0, 15);
INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(4, 4, 'collections', 'Renley collection embodies the strong dignified character in Teak. Delicately shaped and finished to accentuate its natural beauty and elegance, creating a timeless classic that will stand the test of time.', 0, 10);
INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(5, 5, 'collections', 'Monterey collection brings out the rustic feel into a cosy setting. Combining the warm tone rustic Teak with lively fabric, creating a distinctly inviting atmosphere into the outdoor.', 0, 12);
INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(6, 6, 'nav_menu', '', 0, 14);
INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(7, 7, 'nav_menu', '', 0, 3);
INSERT INTO `cc_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES(8, 8, 'collections', 'Kensington collection is an epitome of the traditional British styling, showing unmistakable tradition, touch and sophistication. Highlighting the curve in shaping the overall product, creating a distinctive setting into the scenery of your home.', 0, 7);
